webpackJsonp([0x992fbab5a1dc1000],{"./node_modules/json-loader/index.js!./.cache/json/html-page-structure.json":function(t,a){t.exports={data:{markdownRemark:{html:'<h2>Page Structure</h2>\n<p>To create your pages in <code>HTML</code>, you need to know how to structure a page in <code>HTML</code>, basically, the structuring a page follows the order below:</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token doctype">&lt;!DOCTYPE html></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>html</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>head</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>title</span><span class="token punctuation">></span></span>Title of the Page<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>title</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>head</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>body</span><span class="token punctuation">></span></span>\n    <span class="token comment" spellcheck="true">&lt;!-- Content --></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>body</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>html</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>1º - The <code>&#x3C;!DOCTYPE html></code> statement must always be the first to appear on an <code>HTML</code> page and tell the browser which version of the language is being used. In this case, we are working with <code>HTML5</code>.</p>\n<p>2º - The <code>&#x3C;html></code> and <code>&#x3C;/html></code> tags tell the web browser where the <code>HTML</code> code starts and ends.</p>\n<p>3º - The <code>&#x3C;head></code> and <code>&#x3C;/head></code> tags contains informations about the web site, exemple: style, meta-tags, scripts, etc…</p>\n<p>4º - The <code>&#x3C;title></code> and <code>&#x3C;/title></code> tags tell the browser what the page title is. The title can be seen by identifying the tab in your internet browser. The text that is defined between these tags is also the text that is used as title by the search engines when they present the pages in the results of a search.</p>\n<p>5º - Between the <code>&#x3C;body></code> and <code>&#x3C;/ body></code> tags the page content is placed, which is what is displayed in the browser.</p>\n<h4>More Information:</h4>\n<p><a href="https://www.w3schools.com/html/html_intro.asp">HTML: Introduction</a></p>',fields:{slug:"/html/page structure/"},frontmatter:{title:"Page Structure"}}},pathContext:{slug:"/html/page structure/"}}}});
